import React from 'react';
import {useNavigate} from 'react-router-dom';

function NewPage() {
    const navigate = useNavigate();
    const handleLogin=()=>{
        navigate("/");
    }

    return (
         <center>
            <h1>Welcome!! login to continue...</h1>
            <button onClick={handleLogin}>Login</button>
         </center>
    );
}

export default NewPage;
